def solve():
    

    Tinf = float(entry1.get())
    Emi = float(entry2.get())
    Tin = float(entry3.get())

    T2assumed = 2*Tinf
    Tinf = Tinf+273
    Tin = Tin+273
    T2assumed = T2assumed+273
    Nu=0

    while(1):
        Tf = (T2assumed + Tinf)/2
        beta = 1/Tf
        Gr = (10*beta*(T2assumed-Tinf))/math.pow(1.623*0.00001,2)
        a=Gr*0.71
        if(a>math.pow(10,4) and a<math.pow(10,9)):
            Nu = 0.59*math.pow((Gr*0.71),1/4)
        elif(a>math.pow(10,9) and a<math.pow(10,13)):
            Nu = 0.1*math.pow(a,1/3)
        hnc = Nu*0.03
        hrad = Emi*5.67*math.pow(10,-8)*(math.pow(T2assumed,2)+math.pow(Tinf,2))*(T2assumed+Tinf)
        RHS = (((0.03+hnc)*(T2assumed-Tinf) + hrad*(T2assumed-Tinf)))
        
        T2cal = (-1*RHS*0.1) + Tin
        if (((T2assumed-T2cal)/T2assumed)<0.05):
            break
        else:
            T2assumed = (T2assumed+T2cal)/2

    T2cal = round(T2cal,2)
    print(T2cal-273)
    Qconv = round(hnc*(T2cal-Tinf),2)
    if (Qconv<0):
        Qconv = 0
    Qrad = round(hrad*(T2cal-Tinf),2)
    if (Qrad<0):
        Qrad = 0
    Qcond = round((Qconv/Nu),2)
    if (Qcond<0):
        Qcond = 0
    Qtotal = Qconv + Qrad + Qcond
    
